import {GET_ALL_POKEMONS, GET_POKEMON_BY_ID, GET_POKEMON_BY_NAME, GET_ALL_TYPES, CREATE_POKEMON} from "./actions";

const initialState = {
    allPokemons: [],
}

const reducer = (state = initialState, action) =>{
    switch (action.type) { //switch que evalua el action type
        case GET_ALL_POKEMONS:
        case GET_POKEMON_BY_ID:
        case GET_POKEMON_BY_NAME:
        case GET_ALL_TYPES:
        case CREATE_POKEMON:
        default:
            return { ...state };
    }
};

export default reducer;

//El reducer es una funcion que es quien sabe que hacerle al estado global. Lo recibe y recibe la action que dice que hacer
